export default (state = {}, action) => {
    state = {
        test: 'i am redux test',
        products:[],
        ...state
    }
    switch (action.type) {
        case 'GET_PRODUCTS_LIST':
            let products = action.payload;

            return {
                ...state,
                products: products
            }
       
        default:
            return state
    }
    return state;
}
